import React, { useEffect } from "react";
import "./App.css";
import uniqid from "uniqid";
import data from "./components/data";

function App() {
  useEffect(() => {
    fetch("https://api.jikan.moe/v4/anime/38000/characters")
      .then((response) => response.json())
      .then((data) => setData(data.data));
  }, []);

  return (
    <div>
      {console.log(data[50].character.images.jpg.image_url)}
      {data[20].character.name !== undefined && (
        <h1>{data[20].character.name}</h1>
      )}
    </div>
  );
}

export default App;
